import React, { Component } from "react";
import './stage.css'

class Stage extends Component {
  render() {
    return (
      <div name='Stage'>
       <h4>{this.props.stageName}</h4>
       <button>Add Task</button>
      </div>
    );
  }
}

export default Stage;
